import 'package:climbing_diary/core/data/district.dart';
import 'package:climbing_diary/core/data/region.dart';
import 'package:climbing_diary/core/data/sector.dart';
import 'package:climbing_diary/core/failures/failure.dart';
import 'package:climbing_diary/features/ice_climbing/domain/entities/ice_district.dart';
import 'package:climbing_diary/features/ice_climbing/domain/entities/ice_sector.dart';
import 'package:dartz/dartz.dart';
import 'package:injectable/injectable.dart';

abstract class IceRegionsDataSource {
  Future<Either<Failure, List<IceDistrict>>> getDistricts();
  Future<Either<Failure, List<IceSector>>> getSectors(
      {required IceDistrict district});
}

@LazySingleton(as: IceRegionsDataSource)
class MockIceRegionsDataSource implements IceRegionsDataSource {
  final List<IceDistrict> _districts = [];
  final Map<IceDistrict, List<IceSector>> _sectors = {};

  MockIceRegionsDataSource() {
    final moscow = Region(name: 'Москва и область');
    final caucasus = Region(name: 'Северный кавказ');

    final naroFominsk = IceDistrict(
      name: 'Наро-Фоминский район, СНТ Лесной',
      region: moscow,
      image:
          'https://sun1-47.userapi.com/impg/3VW79oaXqedj5fD4CuX4ccvqcF4if6dNgdSfPg/6mM_UsN9ntQ.jpg?size=1242x1234&quality=95&sign=9e66838aba3b3f42a82261a77c0c8bcb&type=album',
    );

    final naroFominskIcicle = IceSector(
      name: 'Сосулька',
      district: naroFominsk,
      image:
          'https://sun1-47.userapi.com/impg/3VW79oaXqedj5fD4CuX4ccvqcF4if6dNgdSfPg/6mM_UsN9ntQ.jpg?size=1242x1234&quality=95&sign=9e66838aba3b3f42a82261a77c0c8bcb&type=album',
      artificialIce: true,
    );

    final digoria = IceDistrict(
      name: 'Дигория',
      region: caucasus,
      image:
          'data:image/jpeg;base64,',
    );

    final digoriaWall = IceSector(
      name: 'Стенка',
      district: digoria,
      waterfallIce: true,
      image: 'https://risk.ru/u/img/15/14919-670.jpg',
    );

    final digoriaRivers = IceSector(
      name: 'Ручейки',
      district: digoria,
      waterfallIce: true,
      image: 'https://risk.ru/u/img/15/14924-670.jpg',
    );

    _districts.add(naroFominsk);
    _districts.add(digoria);

    _sectors[naroFominsk] = [naroFominskIcicle];

    _sectors[digoria] = [digoriaRivers, digoriaWall];
  }

  @override
  Future<Either<Failure, List<IceDistrict>>> getDistricts() async {
    return Right(_districts);
  }

  @override
  Future<Either<Failure, List<IceSector>>> getSectors(
      {required IceDistrict district}) async {
    return Right(_sectors[district] ?? []);
  }
}
